import React from 'react';
import {Link} from 'react-router-dom'


const Nav =()=>{
    return(
        <div>
            <ul>
                <li><Link to="/">Products</Link></li>
                <li><Link to="/">Add Product</Link></li>
                <li><Link to="/">Update Product</Link></li>
                <li><Link to="/">Logout</Link></li>
                <li><Link to="/">Profile</Link></li>

            </ul>
        </div>
    )
}

export default Nav;
